import { Routes, Route } from "react-router-dom";
import Navbar from "./NavBar";
import AgentsPage from "./AgentPage/AgentsPage";
import HardwareTable from "./HardwarePage";
import SoftwareTable from "./SoftwarePage";
import "../css/App.css";

function App() {
  return (
    <>
      <div className="page-content">
        <Navbar />
        <Routes>
          <Route path="/" element={<AgentsPage />} />
          {/* <Route path="/post/:post_id" element={<SinglePost />} />
          <Route path="/edit_post/:post_id" element={<EditPost />} />
          <Route path="/create_post" element={<CreatePost />} /> */}
        </Routes>
      </div>
    </>
  );
}

export default App;
